import React, { Component } from 'react';
import '../Styles/Profile.css';
import Navigation from '../Components/Navigation';
import Cities from '../static_resources/cities.png';
import Footer from '../Components/Footer';

class CityData extends Component {
  render() {
    return (
      <div>
        <Navigation />
        <p></p>
        <h1>{this.props.city.name}</h1>
        <img src={this.props.city.image} class="cover-image" />
        <p></p>
        <h4>Median Age: {this.props.city.age}</h4>
        <h4>Number of Sunny Days: {this.props.city.sunnyDays}</h4>
        <h4>Median House Price: {this.props.city.housePrice}</h4>
        <h4>Crime Rate: {this.props.city.crimeRate}</h4>
        <h4>Economic Growth: {this.props.city.economicGrowth}</h4>
        <h4>Average Education Level: {this.props.city.eduLevel}</h4>
        <h4>Political Leaning: {this.props.city.politics}</h4>
        <h4>Diversity: {this.props.city.diversity}</h4>
        <h4>Air Quality Index: {this.props.city.airQuality}</h4>
        <Footer />
      </div>
    );
  }
}

export default CityData;
